import navUrl1 from '../../images/connent/icon_5.png';
import navUrl2 from '../../images/connent/icon_2.png';
import navUrl3 from '../../images/connent/icon_3.png';
import navUrl4 from '../../images/connent/icon_4.png';
import navUrl5 from '../../images/connent/icon_6.png';
import navUrl6 from '../../images/connent/icon_1.png';

import React from 'react';
import '../home/home.scss';
import { Icon } from 'antd';

class Home extends React.Component {
	state = {
		cartList: [{
			allnum: '4895',
			stitle: '扫描项目',
			number: '696',
			icon: navUrl1
		}, {
			allnum: '6968',
			stitle: '扫描次数',
			number: '696',
			icon: navUrl2
		}, {
			allnum: '6968890',
			stitle: '代码行数',
			number: '696',
			icon: navUrl3
		}],

		charList: [{
			allnum: '4895',
			stitle: '正在扫描',
			icon: navUrl4
		}, {
			allnum: '6968',
			stitle: '排队等候',
			icon: navUrl5
		}, {
			allnum: '6968890',
			stitle: '剩余并发',
			icon: navUrl6
		}]
	};

	render() {
		return (
			<div className="home-warp">
				<div className="user-chart all-chart">
					<div className="user-chart-list">
						<div className="chart-item-stitle all-title">DMSCA汇总分析<span>（只统计各项目最后一次扫描结果）</span></div>
						<div className="chart-item-content"></div>
					</div>
				</div>

				<div className="user-chart all-chart">
					<div className="user-chart-list">
						<div className="chart-item-stitle all-title">按问题类型汇总</div>
						<div className="chart-item-content"></div>
					</div>
				</div>

				<div className="user-chart all-chart">
					<div className="user-chart-list">
						<div className="chart-item-stitle all-title">汇总分析结果</div>
						<div className="chart-item-content"></div>
					</div>
				</div>

				<div className="user-chart all-chart">
					<div className="user-chart-list">
						<div className="chart-item-stitle all-title">汇总分析结果分布</div>
						<div className="chart-item-content"></div>
					</div>
					<div className="user-chart-list">
						<div className="chart-item-stitle all-title">按问题类型汇总分布</div>
						<div className="chart-item-content"></div>
					</div>
				</div>
			</div>
		);
	}

	componentDidMount() {

	}

}

export default Home
